import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import AcUnitRoundedIcon from '@material-ui/icons/AcUnit';
import TitleIcon from '@material-ui/icons/Title';
import Link from '@material-ui/core/Link';


const useStyles = makeStyles((theme) => ({
    typographyStyles: {
        flex: 1,
        color: 'rgb(228, 130, 74)',
        fontSize: '40px',
        marginTop: '40px',
        marginLeft: '10px'
    },

    root: {
        boxShadow: "none",
        backgroundColor: "#000000",
        height: '70px',
    },

    titleIcon: {
        color: 'rgb(228, 130, 74)',
        marginTop: '40px',
        marginRight: '20px',
        fontSize: '50px',
        border: 'solid 2px rgb(228, 130, 74)'

    },

    aboutMe:{
        marginTop: '40px',
        marginRight: '70px',
        
    },

    aboutMeLink:{
        color: 'rgb(228, 130, 74)',
        fontSize: '20px'
    }
    
}))

const NavBar = () => {
    const classes = useStyles();
    const preventDefault = (event) => event.preventDefault();
    return(
        <AppBar position="static" className={classes.root}>
            <Toolbar>
                <Typography className={classes.typographyStyles}>
                    Thomas Defilippis
                </Typography>
                <Typography className={classes.aboutMe}>
                    <Link href="#" onClick={preventDefault} className={classes.projects}>
                        About Me
                    </Link>
                    <Link href="#" onClick={preventDefault} className={classes.aboutMeLink}>
                        About Me
                    </Link>
                </Typography>
                <TitleIcon className={classes.titleIcon}/>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
